import '../../styles/itemHeaderComponent.css';
const ItemHeaderComponent = () => {
  return (
    <div className="content-header-item">
      <div>
        <input type="text" />
        <button>/</button>
      </div>
    </div>
  );
};
export default ItemHeaderComponent;
